// import React from 'react'
import './App.css';
import Header from './components/Header';


const App = () => {
  return (
    <div className="app-wrapper">
      <Header />

      <div className="content">
        <div>
          <img src="https://images.pexels.com/photos/3873529/pexels-photo-3873529.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"></img>
        </div>
        <div>Ava + description</div>
        <div>My posts</div>
        <div>New Post</div>
        <div>Post1</div>
        <div>Post2</div>

      </div>

    </div>

  );
}

export default App;
